export const HasilScreen = () => {
  return (
    <View style={styles.container}>
      <View style={styles.box}></View>
      <View style={styles.box2}>
        <View style={styles.showbox}>
          <Text>(Lokasi Keberangkatan) - (Lokasi Tujuan)</Text>
          <Text>
            <Icon name="user" size={40}></Icon>
            Elang
          </Text>
          <Text>(Tanggal Keberangkatan)</Text>
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 0.8,
  },
  box: {
    backgroundColor: "green",
    flex: 1,
  },
  box2: {
    flex: 3,
  },
  showbox: {
    borderWidth: 1,
    borderRadius: 7,
    padding: 17,
    margin: 20,
  },
});

